message:
Muito interessante que a caserna tenha propositalmente liberado alguns nomes para que o próprio povo tenha o direito de saber quem são os que estão ignorando os clamores da população diante de um estado ilegítimo que se impõe. São eles:

1. General Valerio Stumpf Trindade - Comando do Estado-Maior do Exército: amiguíssimo de José Levi, ex-AGU de Bolsonaro e hoje assessor da presidência do TSE de Alexandre de Moraes;

2. General Tomás Miguel Miné Ribeiro Paiva – Comando Militar do Sudeste: responsável pelo reenquadramento de matérias na AMAN e de uma posição mais progressista enquanto comandou a instituição formadora de oficiais. Teve passagens políticas pelo governo FHC e assessorou o Itamaraty;

3. General Richard Fernandez Nunes – Comando Militar do Nordeste.
